  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={} className="App-logo" alt="logo" /> */}
        <p>
          Input a whole number over 1 to convert it to roman flavoured numbers
        </p>
        <form>
          <div className='input-div'>
            <label>Number:</label>
            <input className="number-input" type="text" value={input} onChange={e => setInput} />
          </div>
        </form>

        <p></p>
      </header>
    </div>
  );
}

export default App;
